import './Transaction.css'
import { v4 as uuidv4 } from 'uuid';

const Transaction =(props)=>{
    const {Items} = props
    return(
        <ul className="item-list">
            {Items.map((element)=>{
                return <Item {...element} key={uuidv4()}/>
                //return <Item name={element.name} tel={element.tel}/>
            })}
        </ul>
    );
}
export default Transaction



